function LogDefineEstuturaFinalFirebase(TempoTotal, TempoTotalWatson, TempoTotalServidor, Mensagem, Autor) {
    var Estrutura = "";
    
    //  Define a estutura
    
    Estrutura = "<tr>\n<td style=\"text-align: center;padding: 2px;border-bottom: 1px solid \#ddd;border-top: 1px solid \#ddd;border-left: 1px solid \#ddd;border-right: 1px solid \#ddd;font-size:12px;\"><b>{{tempototal}}</b></td>\n<td style=\"text-align:Left;padding: 2px;border-bottom: 1px solid \#ddd;border-top: 1px solid \#ddd;border-left: 1px solid \#ddd;border-right: 1px solid \#ddd;font-size:12px;\">{{tempototalwatson}}</td>\n<td style=\"text-align:Left;padding: 2px;border-bottom: 1px solid \#ddd;border-top: 1px solid \#ddd;border-left: 1px solid \#ddd;border-right: 1px solid \#ddd;font-size:12px;\">{{tempototalservidor}}</td>\n<td style=\"text-align:Left;padding: 2px;border-bottom: 1px solid \#ddd;border-top: 1px solid \#ddd;border-left: 1px solid \#ddd;border-right: 1px solid \#ddd;font-size:12px;\">{{mensagem}}</td>\n<td style=\"text-align:Left;padding: 2px;border-bottom: 1px solid \#ddd;border-top: 1px solid \#ddd;border-left: 1px solid \#ddd;border-right: 1px solid \#ddd;font-size:12px;\">{{autor}}</td>\n</tr>";
        
    //  obtem o valor tempotal
    
    Estrutura = ebfReplace(Estrutura, "{{tempototal}}", TempoTotal);
        
    //  obtem o valor da entrada
    
    Estrutura = ebfReplace(Estrutura, "{{tempototalwatson}}", TempoTotalWatson);
        
    //  obtem o valor da entrada
    
    Estrutura = ebfReplace(Estrutura, "{{tempototalservidor}}", (TempoTotal - TempoTotalWatson));
        
    //  obtem o valor da entrada
    
    Estrutura = ebfReplace(Estrutura, "{{mensagem}}", Mensagem);
        
    //  obtem o valor da entrada
    
    Estrutura = ebfReplace(Estrutura, "{{autor}}", Autor);
        
    //  Fim
    
    return (Estrutura);
    
}

