function SofiaConversaInicial(Id) {
    var Mensagem = "";
    var Tabela;
    var Informacoes = "";
    var Lista;
    var Coisa;
    var Tebela;
    
    //  Abre consulta para obter a descrição
    
    Tabela = ebfSQLExecuteQuery("\nSelect\n  wch_contexto.wch_con_id,\n  wch_contexto.wch_con_url,\n  wch_contexto.wch_con_workspace\nFrom\n  wch_contexto\nWhere\n  wch_contexto.wch_con_id = ?\n\n\n/*WHERE_ADD*/\n/*ORDER_NEW*/\n", [Id], null);
        
    //  Posiciona a conversa para o final.
    
    ebfHtmlSetDOMAttribute(ebfHtmlGetElementById("conversa"), "scrollTop", ebfHtmlGetDOMAttribute(ebfHtmlGetElementById("conversa"),"scrollHeight"));
        
    //  Guarda a URL do contexto inicial.
    
    ebfSetSessionAttribute("url", Tabela.field("wch_con_url", 'string'), true);
        
    //  abre consulta
    
    Tebela = ebfSQLExecuteQuery("\nSelect\n  wch_mensagem.wch_men_mensagem,\n  wch_mensagem.wch_con_id\nFrom\n  wch_mensagem\nWhere\n  wch_mensagem.wch_con_id = ?\n\n\n/*WHERE_ADD*/\n/*ORDER_NEW*/\n", [Id], null);
        
    //  Tem conversa?
    
    if (ebfSQLEOF(Tebela)) {
        
        //  fecha consulta
        
        ebfSQLClose(Tabela);
            
        //  Fim
        
        return;
        
    } else {
        
        //  Sofia - Criar mensagem
        
        SofiaCriarMensagem(("<p></p>" + (ebfReplace("<div class=\"msg-watL\" style=\"overflow:auto \"><span style=\"position: relative !important;border: 1px solid \#D1E1D3;margin-bottom: 15px;display: inline-block;max-width: unset;background: \#fff;word-wrap: break-word;left: 25px;border-radius: .3rem;padding: 3px 10px 3px 5px;height: 22px;width: 50%;!important\">retorno", "retorno", "<div id=\"fountainG\"><div id=\"fountainG_1\" class=\"fountainG\"></div><div id=\"fountainG_2\" class=\"fountainG\"></div><div id=\"fountainG_3\" class=\"fountainG\"></div></div>") + "</span></div>")), ebfListParamsCreate(ebfListParamsCreate("id", "Loading")))
            
        //  Obtém as coordenadas.
        
        ebfGetGPSCoords(reduceVariable("Sofia - Obter Coordenadas Callback OK"), reduceVariable("Sofia - Obter Coordenadas Callback Erro"));
            
        //  fecha consulta
        
        ebfSQLClose(Tabela);
            
        //  Fim
        
        return;
        
    }
}

