                    MapaDeParametros = ebfMapCreateFromList(ebfListParamsCreate("Acao", Acao), ebfListParamsCreate("Json", ebfURLEncoder(Json)), ebfListParamsCreate("Pasta", Pasta), ebfListParamsCreate("Ficha", Ficha), ebfListParamsCreate("Usuario", Usuario), ebfListParamsCreate("Estrutura", ebfURLEncoder(Estrutura)));
                        
