function SofiaColocarMensagemNaConversa(Mensagem) {
    var Mensagemtratada = "";
    var Conexao = "";
    
    //  Mensagem é  nula?
    
    if (isNullOrEmpty(Mensagem)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Conexão
        
        Conexao = ebfConnectionType();
            
        //  Possui conexão com a internet?
        
        if (((Conexao != "No network connection") && (Conexao != "Unknown connection"))) {
            
            //  Concatena mensagem do usuario
            
            Mensagemtratada = ("<p></p>" + ("<div class=\"msg-me\" style=\"overflow:auto \"><span>" + Mensagem + ("<br>" + "<div align=\"right\" style=\"font-size:75% !important\"><span style=\\\"font-size:70%;\\\">" + ebfFormatDateTime(ebfDateToday(), "k:mm:ss") + "</span></div>") + "</span></div>"));
                
            //  Limpa o componente conversa
            
            ebfFormChangeComponentValue("mensagem", "");
                
            //  Executar inserção
            
            ebfSQLExecuteUpdate("INSERT INTO wch_mensagem (wch_men_mensagem, /**/wch_men_data_hora, /**/wch_con_id, /**/wch_men_usuario) VALUES (?, /**/?, /**/?, /**/?)", [Mensagemtratada, ebfFormatDateTime(ebfDateToday(), "dd/MM/yyyy k:mm:ss"), ebfGetSessionAttribute("idcontexto", false), "U"], null);
                
            //  Cria a msg de carregamento.
            
            SofiaCriarMensagem((ebfReplace("<div class=\"msg-watL\" style=\"overflow:auto \"><span style=\"position: relative !important;border: 1px solid \#D1E1D3;margin-bottom: 15px;display: inline-block;max-width: unset;background: \#fff;word-wrap: break-word;left: 25px;border-radius: .3rem;padding: 3px 10px 3px 5px;height: 22px;width: 50%;!important\">retorno", "retorno", "<div id=\"fountainG\"><div id=\"fountainG_1\" class=\"fountainG\"></div><div id=\"fountainG_2\" class=\"fountainG\"></div><div id=\"fountainG_3\" class=\"fountainG\"></div></div>") + "</span></div>"), ebfListParamsCreate(ebfListParamsCreate("id", "Loading")))
                
            //  Posiciona a conversa para o final.
            
            ebfHtmlSetDOMAttribute(ebfHtmlGetElementById("conversa"), "scrollTop", ebfHtmlGetDOMAttribute(ebfHtmlGetElementById("conversa"),"scrollHeight"));
                
            //  Guarda a msg digitada na sessão.
            
            ebfSetSessionAttribute("msgDigitada", Mensagem, false);
                
            //  Fim
            
            return;
            
        } else {
            
            //  Mensagem de alerta sem conexão.
            
            alert("Você está sem conexão com a internet. Verifique e tente novamente.");
                
            //  Fim
            
            return;
            
        }
    }
}

