function NovaSofiaPesquisarContexto() {
    var Texto = "";
    var ListaDeContextos;
    var QuantidadeDeContextos = 0;
    var Cont = 0;
    var NomeDoContexto = "";
    var ReferneciaDoParagrafo;
    var DescricaoDoContexto = "";
    var Css = "";
    var Top = 0;
    var Integracaoframe;
    var Id = "";
    var Style;
    var Body;
    var Img;
    
    
    
    Cont = 1;
        
    //  Texto
    
    Texto = ebfRemoveAccents(ebfHtmlGetDOMAttribute(ebfIntegracaoGetElementById("Integracao", "searchfield"),"value").toUpperCase());
        
    //  Obter lista de contxtos
    
    ListaDeContextos = ebfHtmlChildNodes(ebfIntegracaoGetElementById("Integracao", "friends"));
        
    //  Tamanho da lista
    
    QuantidadeDeContextos = ListaDeContextos.length;
        
    //  integracaoFrame
    
    Integracaoframe = ebfHtmlChildNodes(ebfHtmlGetElementById("Integracao"))[1-1];
        
    //  body
    
    Body = ebfHtmlGetParent(ebfIntegracaoGetElementById("Integracao", "chatbox"));
        
    //  Acabou a lista?
    
    while ((!(Cont > QuantidadeDeContextos))) {
        
        //  Referência do paragrafo
        
        ReferneciaDoParagrafo = ebfHtmlChildNodes(ListaDeContextos[Cont-1])[2-1];
            
        //  Nome do Contexto
        
        NomeDoContexto = ebfRemoveAccents(/* NOT FOUND */ebfHtmlGetInnerHtml(ebfHtmlChildNodes(ReferneciaDoParagrafo)[1-1]).toUpperCase());
            
        //  Descrição do contexto
        
        DescricaoDoContexto = ebfRemoveAccents(/* NOT FOUND */ebfHtmlGetInnerHtml(ebfHtmlChildNodes(ReferneciaDoParagrafo)[3-1]).toUpperCase());
            
        //  Existe subsequencia?
        
        if ((ebfSearchSubstring(NomeDoContexto, Texto) || ebfSearchSubstring(DescricaoDoContexto, Texto))) {
            
            //  Mostra
            
            ebfHtmlCssDefineStyle(ListaDeContextos[Cont-1], "display", "block");
                
            //  referência da img
            
            Img = ebfHtmlChildNodes(ListaDeContextos[Cont-1])[1-1];
                
            //  id
            
            Id = ebfHtmlGetDOMAttribute(Img,"id");
                
            //  obter top da imagem
            
            Top = ebfExecuteJSFromWindow(Integracaoframe, ebfReplaceAll("document.getElementById(\'\#\#ID\').getBoundingClientRect().top;", "\#\#ID", Id));
                
            //  css
            
            Css = (Css + ebfReplaceAll(ebfReplaceAll(".animate\\#ID {\n  height: 40px;\n  width: 40px;\n  animation: example\\#ID 0.3s;\n  position:absolute;\n  top:6px;\n  left:37px;\n}\n\n/* Safari 4.0 - 8.0 */\n@-webkit-keyframes example\\#ID {\n    0%   {left:12px; top:\\#TOPpx;}  \n   100%  {left:37px; top:6px;}\n}\n\n/* Standard syntax */\n@keyframes example\\#ID {\n    0%   {left:12px; top:\\#TOPpx;}  \n   100%  {left:37px; top:6px;}  \n}\n\n.animatevolta\\#ID {\n  height: 40px;\n  width: 40px;\n  animation: examplevolta\\#ID 0.3s;\n  position:absolute;\n  top:\\#TOPpx !important;\n  left:12px !important;\n}\n\n/* Safari 4.0 - 8.0 */\n@-webkit-keyframes examplevolta\\#ID {\n       0%  {left:37px; top:6px;}    \n   100%   {left:12px; top:\\#TOPpx;}  \n  \n}\n\n/* Standard syntax */\n@keyframes examplevolta\\#ID {\n       0%  {left:37px; top:6px;}     \n  100%   {left:12px; top:\\#TOPpx;}  \n   \n}\n\n", "\\#ID", Id), "\\#TOP", Top));
                
            //  Cont++
            
            Cont = (Cont + 1);
            
        } else {
            
            //  Esconde
            
            ebfHtmlCssDefineStyle(ListaDeContextos[Cont-1], "display", "none");
                
            //  Cont++
            
            Cont = (Cont + 1);
            
        }
    }
        
    //  css animate é nulo?
    
    if (isNullOrEmpty(ebfIntegracaoGetElementById("Integracao", "css_animate"))) {
        
        //  criar style
        
        Style = ebfHtmlCreateHtmlElement("style", ebfListParamsCreate(ebfListParamsCreate("type", "text/css"), ebfListParamsCreate("id", "css_animate")), null);
            
        //  anexar style
        
        ebfHtmlAppendElementAtPosition(Body, Style, 1);
            
        //  importar css
        
        ebfHtmlInnerHtml(Style, Css);
            
        //  Fim
        
        return;
        
    } else {
        
        //  referência do style
        
        Style = ebfIntegracaoGetElementById("Integracao", "css_animate");
            
        //  importar css
        
        ebfHtmlInnerHtml(Style, Css);
            
        //  Fim
        
        return;
        
    }
}

