function SofiaPostDaImagemDoCrud(Guid, CaminhoDaImagem, Imagem) {
    var MapaDeParametros;
    var Url = "";
    
    //  Criar mapa de parâmetros
    
    MapaDeParametros = ebfMapCreateFromList(ebfListParamsCreate("sys", "SSA"), ebfListParamsCreate("caminho", CaminhoDaImagem), ebfListParamsCreate("guid", Guid));
        
    //  Obter url da Retaguarda
    
    Url = ebfGetSessionAttribute("url", false);
        
    //  Envia imagem via post
    
    ebfSendFilePOST((Url + "/Imagemcrud.rule"), MapaDeParametros, ebfMapCreateFromList(ebfListParamsCreate("arquivo", Imagem)));
        
    //  Fim
    
    return;
    
}

