function Sofiamapamarcarpontolista(ListaDePontos, Mapa) {
    var Pontos = "";
    var CLatitude = "";
    var CLongitude = "";
    var CCorDoPonto = "";
    var CTexto = "";
    var Contador = 0;
    var Marcador;
    var Bounds;
    
    
    
    Contador = 1;
        
    //  Criar lista de marcadores
    
    Marcador = new Array();
        
    //  Obter pontos
    
    Pontos = ebfSplit(ListaDePontos, ";");
        
    //  Obter objeto bounds
    
    Bounds = ebfExecuteJS("return new google.maps.LatLngBounds();");
        
    //  Contador é menor ou igual a lista de pontos?
    
    if ((Contador <= Pontos.length)) {
        
        //  Contador = tamanho da lista?
        
        if ((Contador == Pontos.length)) {
            
            //  Obter longitude
            
            CLongitude = ebfSplit(Pontos[Contador-1], ",")[2-1];
                
            //  Obter latitude
            
            CLatitude = ebfSplit(Pontos[Contador-1], ",")[1-1];
                
            //  Definir marcador e centralizar
            
            ebfMapsCreateMarker(Mapa, UtilParsefloat(CLatitude), UtilParsefloat(CLongitude), "Local", null, null, null, null, null, null, true, "Local");
                
            //  Fim
            
            return;
            
        } else {
            
            //  Contador é menor ou igual a lista de pontos?
            
            while ((Contador <= Pontos.length)) {
                
                //  Obter latitude
                
                CLatitude = ebfSplit(Pontos[Contador-1], ",")[1-1];
                    
                //  Obter longitude
                
                CLongitude = ebfSplit(Pontos[Contador-1], ",")[2-1];
                    
                //  Obter cor do ponto
                
                CCorDoPonto = ebfSplit(Pontos[Contador-1], ",")[3-1];
                    
                //  Obter texto
                
                CTexto = ebfSplit(Pontos[Contador-1], ",")[4-1];
                    
                //  Cria marcador para o usuario e define como variável de sessão
                
                Marcador = ebfMapsCreateMarker(Mapa, UtilParsefloat(CLatitude), UtilParsefloat(CLongitude), CTexto, null, null, null, null, CCorDoPonto, null, true, CTexto);
                    
                //  Adc ao bound
                
                /* NOT FOUND */ebfExecuteCustomJSFunction(Bounds, "extend", ebfListParamsCreate(/* NOT FOUND */ebfExecuteCustomJSFunction(Marcador, "getPosition", null)));
                    
                //  Incrementar contador
                
                Contador = (Contador + 1);
                
            }
                
            //  Centralizar
            
            /* NOT FOUND */ebfExecuteCustomJSFunction(Mapa, "fitBounds", ebfListParamsCreate(Bounds));
                
            //  Fim
            
            return;
            
        }
    } else {
        
        //  Fim
        
        return;
        
    }
}

