function SofiaExecutarJs(Texto) {
    var Inicio = 0;
    var TextoAux = "";
    var ListaDeInicios;
    var ListaDeFinais;
    var Indice = 0;
    var TamanhoDaLista = 0;
    var Cont = 0;
    var Retorno = "";
    var Textojs = "";
    
    
    
    Cont = 1;
        
    //  Texto auxilixar
    
    TextoAux = Texto;
        
    //  Criar lista de inicio
    
    ListaDeInicios = new Array();
        
    //  Criar lista de finais
    
    ListaDeFinais = new Array();
        
    //  índice 
    
    Indice = ebfIndexOf(TextoAux, "<!");
        
    //  Indice é maior que 0?
    
    while ((Indice > 0)) {
        
        //  índice inicio
        
        Indice = ebfIndexOf(TextoAux, "<!");
            
        //  Retirar tag
        
        TextoAux = ebfReplace(TextoAux, "<!", "xx");
            
        //  Inserir na lista de inicio
        
        ListaDeInicios = ebfSetElementAtList(ListaDeInicios, (Indice + 2), null);
            
        //  ínicio
        
        Inicio = (Indice + 2);
            
        //  índice fim
        
        Indice = ebfIndexOf(TextoAux, "!>");
            
        //  Retirar tag
        
        TextoAux = ebfReplace(TextoAux, "!>", "xx");
            
        //  Inserir na lista de fim
        
        ListaDeFinais = ebfSetElementAtList(ListaDeFinais, (Indice - Inicio), null);
            
        //  índice 
        
        Indice = ebfIndexOf(TextoAux, "<!");
        
    }
        
    //  Tamanho da lista
    
    TamanhoDaLista = ListaDeInicios.length;
        
    //  Acabou a lista?
    
    while ((!(Cont > TamanhoDaLista))) {
        
        //  Texto js
        
        Textojs = ebfSubstring(TextoAux, ListaDeInicios[Cont-1], ListaDeFinais[Cont-1]);
            
        //  executar js
        
        Retorno = ebfExecuteJS(ebfReplaceAll(Textojs, "\\\"", "\""));
            
        //  remover js do texto
        
        Texto = ebfReplace(Texto, ("<!" + Textojs + "!>"), ((isNullOrEmpty(Retorno)) ? ("") : (Retorno)));
            
        //  cont++
        
        Cont = (Cont + 1);
        
    }
        
    //  Fim
    
    return (Texto);
    
}

