function ObjetoCarregarListaDeElementos(Html) {
    var Divprincipal;
    var ListaDeElementos;
    var Contador = 0;
    var IdDaTag = "";
    var TipoDaTag = "";
    
    
    
    Contador = 1;
        
    //  Dá refresh na grade
    
    /* NOT FOUND */ebfGridRefresh("grdElementos");
        
    //  Cria div principal do componente
    
    Divprincipal = ebfHtmlCreateHtmlElement("div", null, null);
        
    //  Insere conteúdo passado por parâmetro
    
    ebfHtmlInnerHtml(Divprincipal, Html);
        
    //  Obtém todos os filhos da div principal
    
    ListaDeElementos = ebfHtmlGetElementsByTagName("*", Divprincipal);
        
    //  Nenhum filho
    
    if (isNullOrEmpty(ListaDeElementos)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Contador é maior que o tamanho da lista
        
        while ((!(Contador > ListaDeElementos.length))) {
            
            //  Obtém tipo da tag
            
            TipoDaTag = ebfHtmlGetDOMAttribute(ListaDeElementos[Contador-1],"nodeName");
                
            //  Obtém id da tag
            
            IdDaTag = /* NOT FOUND */ebfHtmlGetAttribute(ListaDeElementos[Contador-1], "id");
                
            //  Id é nulo
            
            if (isNullOrEmpty(IdDaTag)) {
                
                //  Incrementa contador
                
                Contador = (Contador + 1);
                
            } else {
                
                //  Insere linha na grade
                
                /* NOT FOUND */ebfGridInsertRowWithoutRefresh("grdElementos");
                    
                //  Insere valor na linha
                
                /* NOT FOUND */ebfGridSetValueNoRefresh("grdElementos", (/* NOT FOUND */ebfGridRowCount("grdElementos") - 1), "ID", IdDaTag);
                    
                //  Insere valor na linha
                
                /* NOT FOUND */ebfGridSetValue("grdElementos", (/* NOT FOUND */ebfGridRowCount("grdElementos") - 1), "Tipo", TipoDaTag.toLowerCase());
                    
                //  Incrementa contador
                
                Contador = (Contador + 1);
                
            }
        }
            
        //  Fim
        
        return;
        
    }
}

