function Mongomapa(IdEndereco, IdMapa) {
    var RefComponente;
    var Endereco = "";
    var ListaEndereco;
    var Contador = 0;
    var EnderecoConcatenado = "";
    var Prefixo = "";
    var RefElemento;
    
    
    
    Contador = 1;
        
    
    
    alert(IdEndereco);
        
    
    
    alert(IdMapa);
        
    //  Quebra endereço
    
    ListaEndereco = ebfSplit(IdEndereco, "|");
        
    //  contador > endereco
    
    while ((!(Contador > ListaEndereco.length))) {
        
        //  Obtem elemento
        
        RefComponente = ebfHtmlGetElementById(ListaEndereco[Contador-1]);
            
        //  Obtem endereco
        
        Endereco = ebfHtmlGetDOMAttribute(RefComponente,"value");
            
        //  Concatena endereco
        
        EnderecoConcatenado = (EnderecoConcatenado + "\n							" + Endereco);
            
        //  Incrementa contador
        
        Contador = (Contador + 1);
        
    }
        
    //  É nulo ou vazio
    
    if (isNullOrEmpty(trim(EnderecoConcatenado))) {
        
        //  Obtem moldura do mapa
        
        RefElemento = ebfHtmlGetElementById(IdMapa);
            
        //  Limpa conteudo
        
        ebfHtmlInnerHtml(RefElemento, null);
            
        //  Fim
        
        return;
        
    } else {
        
        //  Obtem Coordenadas
        
        ebfMapsCodeAddress(EnderecoConcatenado, reduceVariable("MongoDB - Mapa - Monta mapa"), ebfListParamsCreate(IdMapa), null, null);
            
        //  Fim
        
        return;
        
    }
}

