function SofiaObtemMensagemDoContexto(Idcontexto) {
    var Tabela;
    var DivMensagem;
    var Tabelacontexto;
    var Modoapp = "";
    
    //  consulta contexto
    
    Tabelacontexto = ebfSQLExecuteQuery("\nSelect\n  wch_contexto.wch_app_mode\nFrom\n  wch_contexto\nWhere\n  wch_contexto.wch_con_id = ?\n\n\n/*WHERE_ADD*/\n/*ORDER_NEW*/\n", [Idcontexto], null);
        
    //  obtem flag app mode
    
    Modoapp = ebfToString(Tabelacontexto.field("wch_app_mode", 'string'));
        
    //  fechar consulta
    
    ebfSQLClose(Tabelacontexto);
        
    //  Abre consulta e obtem os dados da mensagem
    
    Tabela = ebfSQLExecuteScrollQuery("\nSelect\n  wch_mensagem.wch_men_mensagem,\n  wch_mensagem.wch_men_data_hora,\n  wch_mensagem.wch_men_id,\n  wch_mensagem.wch_con_id,\n  wch_mensagem.wch_men_usuario\nFrom\n  wch_mensagem\nWhere\n  wch_mensagem.wch_con_id = ?\n\n/*WHERE_ADD*/\nOrder By\n  wch_mensagem.wch_men_id\n\n/*ORDER_ADD*/\n", [Idcontexto], null);
        
    //  existem registro na tabela?
    
    while (ebfSQLEOF(Tabela)) {
        
        //  Modo app?
        
        if ((Modoapp == "S")) {
            
            //  limpa conversa toda
            
            ebfHtmlInnerHtml(ebfHtmlGetElementById("conversa"), "");
                
            //  Cria a div de mensagem
            
            DivMensagem = ebfHtmlCreateHtmlElement("div", null, ebfHtmlGetElementById("conversa"));
                
            //  Define o conteúdo da mensagem.
            
            ebfHtmlInnerHtml(DivMensagem, ebfReplaceAll(Tabela.field("wch_men_mensagem", 'string'), "autoplay", ""));
                
            //  Próximo registro da tabela
            
            ebfSQLNext(Tabela);
            
        } else {
            
            //  Cria a div de mensagem
            
            DivMensagem = ebfHtmlCreateHtmlElement("div", null, ebfHtmlGetElementById("conversa"));
                
            //  Define o conteúdo da mensagem.
            
            ebfHtmlInnerHtml(DivMensagem, ebfReplaceAll(Tabela.field("wch_men_mensagem", 'string'), "autoplay", ""));
                
            //  Próximo registro da tabela
            
            ebfSQLNext(Tabela);
            
        }
    }
        
    //  fechar consulta
    
    ebfSQLClose(Tabela);
        
    //  Posiciona a conversa para o final.
    
    ebfHtmlSetDOMAttribute(ebfHtmlGetElementById("conversa"), "scrollTop", ebfHtmlGetDOMAttribute(ebfHtmlGetElementById("conversa"),"scrollHeight"));
        
    //  Fim
    
    return (null);
    
}

function MongoDepoisDeChamar(Parametro, Acao, Json) {
    
    //  Incluir?
    
    if ((Acao == "I")) {
        
        //  Mongo - Depois de chamar agendado
        
        MongoDepoisDeChamarAgendado(Acao, Json)
            
        //  Fim
        
        return ("Incluir");
        
    } else {
        
        //  alterar?
        
        if ((Acao == "A")) {
            
            //  Sofia - Servidor Resposta (Tratando)
            
            SofiaServidorRespostaTratando((Parametro + "||||" + "undefined"))
                
            //  Fim
            
            return ("Alterar");
            
        } else {
            
            //  Salvar alteração?
            
            if ((Acao == "AS")) {
                
                //  Mongo - Depois de chamar agendado
                
                MongoDepoisDeChamarAgendado(Acao, Json)
                    
                //  Fim
                
                return ("Salvar alteração");
                
            } else {
                
                //  Consultar 1?
                
                if ((Acao == "C1")) {
                    
                    //  Sofia - Servidor Resposta (Tratando)
                    
                    SofiaServidorRespostaTratando((Parametro + "||||" + "undefined"))
                        
                    //  Fim
                    
                    return ("Consultar");
                    
                } else {
                    
                    //  Consultar2?
                    
                    if ((Acao == "C2")) {
                        
                        //  Sofia - Servidor Resposta (Tratando)
                        
                        SofiaServidorRespostaTratando((Parametro + "||||" + "undefined"))
                            
                        //  Fim
                        
                        return ("Consultar2");
                        
                    } else {
                        
                        //  Exluir?
                        
                        if ((Acao == "E")) {
                            
                            //  Sofia - Servidor Resposta (Tratando)
                            
                            SofiaServidorRespostaTratando((Parametro + "||||" + "undefined"))
                                
                            //  Fim
                            
                            return ("Excluir");
                            
                        } else {
                            
                            //  Executar Exluisão?
                            
                            if ((Acao == "ES")) {
                                
                                //  Mongo - Depois de chamar agendado
                                
                                MongoDepoisDeChamarAgendado(Acao, Json)
                                    
                                //  Fim
                                
                                return ("Excluir");
                                
                            } else {
                                
                                //  Fim
                                
                                return ("Sem ação definida");
                                
                            }
                        }
                    }
                }
            }
        }
    }
}

function SofiaMontarListaDePerguntas() {
    var ListaDePerguntas;
    var TamanhoDaLista = 0;
    var Cont = 0;
    var Json;
    var Valor = "";
    
    
    
    Cont = 1;
        
    //  Limpar lista
    
    ebfComboClean("lista");
        
    //  Obter shared preferences
    
    Json = /* NOT FOUND */ebfGetAllPreferences(ebfToString(ebfGetSessionAttribute("idcontexto", false)));
        
    //  Json é nulo ou vazio?
    
    if (isNullOrEmpty(Json)) {
        
        //  Desabilitar lista de perguntas
        
        $("lista").disabled = !parseBoolean(false);
            
        //  Fim
        
        return;
        
    } else {
        
        //  Criar objeto json
        
        Json = ebfCreateObjectJSON(Json);
            
        //  Obter lista de perguntas
        
        ListaDePerguntas = ebfGetValueObjectJson(Json, "perguntas");
            
        //  Tamanho da lista
        
        TamanhoDaLista = ListaDePerguntas.length;
            
        //  Acabou a lista?
        
        while ((!(Cont > TamanhoDaLista))) {
            
            //  Valor
            
            Valor = ListaDePerguntas[Cont-1];
                
            //  Alimentar lista
            
            ebfComboPut("lista", Valor, Valor);
                
            //  Cont++
            
            Cont = (Cont + 1);
            
        }
            
        //  Desabilitar lista de perguntas
        
        $("lista").disabled = !parseBoolean(true);
            
        //  Fim
        
        return;
        
    }
}

