function DefineContexxtp(Id, Workspace, Url) {
    var ListaDeResposta;
    var ReferenciaDoHistorico;
    var Message;
    var Bubble;
    var Span;
    var QuantidadeDePerguntas = 0;
    var Cont = 0;
    var Sublista;
    
    
    
    Cont = 1;
        
    //  Lista de respostas
    
    ListaDeResposta = ebfListParamsCreate(ebfListParamsCreate("Really cool stuff!", "resposta"), ebfListParamsCreate("Can you share a link for the tutorial?", "pergunta"), ebfListParamsCreate("Yeah, hold on", "resposta"), ebfListParamsCreate("Can you share a link for the tutorial?", "pergunta"), ebfListParamsCreate("Yeah, hold on", "resposta"));
        
    //  Refernecia
    
    ReferenciaDoHistorico = ebfIntegracaoGetElementById("Integracao", "chat-messages");
        
    //  Definir conteudo
    
    ebfHtmlInnerHtml(ReferenciaDoHistorico, "<label></label>");
        
    //  Tamanho da lista
    
    QuantidadeDePerguntas = ListaDeResposta.length;
        
    //  Acabou a lista?
    
    while ((!(Cont > QuantidadeDePerguntas))) {
        
        //  sublista
        
        Sublista = ListaDeResposta[Cont-1];
            
        //  criar message
        
        Message = ebfHtmlCreateHtmlElement("div", ebfListParamsCreate(ebfListParamsCreate("class", (((Sublista[2-1] == "resposta")) ? ("message") : ("message right")))), ReferenciaDoHistorico);
            
        //  criar bubble
        
        Bubble = ebfHtmlCreateHtmlElement("div", ebfListParamsCreate(ebfListParamsCreate("class", "bubble")), Message);
            
        //  Definir conteudo
        
        ebfHtmlInnerHtml(Bubble, Sublista[1-1]);
            
        //  corner
        
        ebfHtmlCreateHtmlElement("div", ebfListParamsCreate(ebfListParamsCreate("class", "corner")), Bubble);
            
        //  span
        
        Span = ebfHtmlCreateHtmlElement("span", null, Bubble);
            
        //  Definir conteudo
        
        ebfHtmlInnerHtml(Span, ebfFormatDateTime(ebfDateToday(), "k:mm:ss"));
            
        //  cont++
        
        Cont = (Cont + 1);
        
    }
        
    //  Fim
    
    return;
    
}

function MostrarMensagens(Id, Contexto, Descricao) {
    var Src = "";
    var Img;
    var Contextoselecionado;
    
    //  src
    
    Src = ebfHtmlGetDOMAttribute(ebfIntegracaoGetElementById("Integracao", Id),"src");
        
    //  Criar imagem
    
    Img = ebfHtmlCreateHtmlElement("img", ebfListParamsCreate(ebfListParamsCreate("id", "imgSelecionado"), ebfListParamsCreate("src", Src), ebfListParamsCreate("class", "floatingImg"), ebfListParamsCreate("style", "width:50px;\nheight:50px;\nleft:37px;\ntop:6px;\nposition:absolute;\nborder-radius: 50%;"), ebfListParamsCreate("idold", Id)), ebfIntegracaoGetElementById("Integracao", "chatbox"));
        
    //  Definir classe
    
    ebfHtmlSetAttribute(Img,"class",("animate" + Id));
        
    //  Anexar imagem 
    
    ebfHtmlAppendElementAt(ebfIntegracaoGetElementById("Integracao", "chatbox"),Img);
        
    //  contextoSelecionado
    
    Contextoselecionado = ebfIntegracaoGetElementById("Integracao", "contextoSelecionado");
        
    //  Agendar fluxo
    
    ebfSetRuleExecutionTime(reduceVariable("Adicionar classe animate"), new Array(), 100);
        
    //  Agendar fluxo
    
    ebfSetRuleExecutionTime(reduceVariable("HTML - Definir atributo DOM"), ebfListParamsCreate(ebfIntegracaoGetElementById("Integracao", "chat-messages"), "class", "animate"), 150);
        
    //  Definir contexto
    
    ebfHtmlInnerHtml(Contextoselecionado, Contexto);
        
    //  Definir descrição
    
    ebfHtmlInnerHtml(ebfIntegracaoGetElementById("Integracao", "descricaoSelecionado"), Descricao);
        
    //  esconder friendslist
    
    ebfHtmlSetDOMAttribute(ebfIntegracaoGetElementById("Integracao", "friendslist"), "style", "display:none;");
        
    //  mostrar chatview
    
    ebfHtmlSetDOMAttribute(ebfIntegracaoGetElementById("Integracao", "chatview"), "style", "display:block;");
        
    //  mostrar chat-messages
    
    ebfHtmlSetDOMAttribute(ebfIntegracaoGetElementById("Integracao", "chat-messages"), "style", "opacity:1;");
        
    //  Fim
    
    return;
    
}

