function Mascaramas(Id, Mascara) {
    
    //  Executar js
    
    ebfExecuteJS(ebfReplace(ebfReplace("function fMasc() {\n				obj=document.getElementById(\'\#\#id\');\n				masc=\'\#\#mascara\'\n				setTimeout(\"fMascEx()\",1)\n			}\n			function fMascEx() {\n				obj.value=masc(obj.value)\n			}\n			function mTel(tel) {\n				tel=tel.replace(/\\D/g,\"\")\n				tel=tel.replace(/^(\\d)/,\"($1\")\n				tel=tel.replace(/(.{3})(\\d)/,\"$1)$2\")\n				if(tel.length == 9) {\n					tel=tel.replace(/(.{1})$/,\"-$1\")\n				} else if (tel.length == 10) {\n					tel=tel.replace(/(.{2})$/,\"-$1\")\n				} else if (tel.length == 11) {\n					tel=tel.replace(/(.{3})$/,\"-$1\")\n				} else if (tel.length == 12) {\n					tel=tel.replace(/(.{4})$/,\"-$1\")\n				} else if (tel.length > 12) {\n					tel=tel.replace(/(.{4})$/,\"-$1\")\n				}\n				return tel;\n			}\n			function mCNPJ(cnpj){\n				cnpj=cnpj.replace(/\\D/g,\"\")\n				cnpj=cnpj.replace(/^(\\d{2})(\\d)/,\"$1.$2\")\n				cnpj=cnpj.replace(/^(\\d{2})\\.(\\d{3})(\\d)/,\"$1.$2.$3\")\n				cnpj=cnpj.replace(/\\.(\\d{3})(\\d)/,\".$1/$2\")\n				cnpj=cnpj.replace(/(\\d{4})(\\d)/,\"$1-$2\")\n				return cnpj\n			}\n			function mCPF(cpf){\n				cpf=cpf.replace(/\\D/g,\"\")\n				cpf=cpf.replace(/(\\d{3})(\\d)/,\"$1.$2\")\n				cpf=cpf.replace(/(\\d{3})(\\d)/,\"$1.$2\")\n				cpf=cpf.replace(/(\\d{3})(\\d{1,2})$/,\"$1-$2\")\n				return cpf\n			}\n			function mCEP(cep){\n				cep=cep.replace(/\\D/g,\"\")\n				cep=cep.replace(/^(\\d{2})(\\d)/,\"$1.$2\")\n				cep=cep.replace(/\\.(\\d{3})(\\d)/,\".$1-$2\")\n				return cep\n			}\n			function mNum(num){\n				num=num.replace(/\\D/g,\"\")\n				return num\n			}\n\nfMasc();", "\#\#id", Id), "\#\#mascara", Mascara));
        
    //  Fim
    
    return;
    
}

