function SofiaMontarOptionsDaLista(Valores, Padrao) {
    var ListaDeValores;
    var QuantidadeDeLista = 0;
    var Cont = 0;
    var Options = "";
    var Selected = "";
    
    
    
    Cont = 1;
        
    //  Lista
    
    ListaDeValores = ebfSplit(Valores, "/");
        
    //  Tamanho da lista
    
    QuantidadeDeLista = ListaDeValores.length;
        
    //  Acabou a lista?
    
    while ((!(Cont > QuantidadeDeLista))) {
        
        //  selected
        
        Selected = (((ListaDeValores[Cont-1] == Padrao)) ? ("selected") : (""));
            
        //  option
        
        Options = (Options + ebfReplaceAll(ebfReplaceAll("<option \\#SELECTED value=\"\\#VALOR\">\\#VALOR</option>", "\\#VALOR", ListaDeValores[Cont-1]), "\\#SELECTED", Selected));
            
        //  Cont++
        
        Cont = (Cont + 1);
        
    }
        
    //  Fim
    
    return (Options);
    
}

