function GpsMoverMarcador(Latatual, Longatual, Latold, Lonold) {
    
    //  Mover marcador
    
    ebfExecuteJSFromWindow(GpsObterIntegracao(), ebfReplace(ebfReplace(" var marker = ebfGetLocalVariable(\'MAKER\');\n\n  var current = new google.maps.LatLng(\#\#current);\n\n  var moveto = new google.maps.LatLng(\#\#move);\n\n  var lat = current.lat();\n\n  var lng = current.lng();\n\n\n  var deltalat = (moveto.lat() - current.lat()) / 100;\n\n  var deltalng = (moveto.lng() - current.lng()) / 100;\n\n\n  for (var i = 0; i < 100; i++) {\n    (function() {\n      setTimeout(\n        function() {\n          \nvar lat = marker.position.lat();\n\n          var lng = marker.position.lng();\n\n          lat += deltalat;\n          lng += deltalng;\n          latlng = new google.maps.LatLng(lat, lng);\n          marker.setPosition(latlng);\n          //ebfGetLocalVariable(\'VFMAPA\').setCenter(latlng);\n          //ebfGetLocalVariable(\'VFMAPA\').setZoom(19);\n        }, 10 * 10\n      );\n    })(i)\n  }", "\#\#current", (Latold + "," + Lonold)), "\#\#move", (Latatual + "," + Longatual)));
        
    //  Fim
    
    return;
    
}

function NovaSofiaExecutarJs(Texto) {
    var Inicio = 0;
    var TextoAux = "";
    var ListaDeInicios;
    var ListaDeFinais;
    var Indice = 0;
    var TamanhoDaLista = 0;
    var Cont = 0;
    var Retorno = "";
    var TextoJavascript = "";
    
    
    
    Cont = 1;
        
    //  Texto auxilixar
    
    TextoAux = Texto;
        
    //  Criar lista de inicio
    
    ListaDeInicios = new Array();
        
    //  Criar lista de finais
    
    ListaDeFinais = new Array();
        
    //  índice 
    
    Indice = ebfIndexOf(TextoAux, "<!");
        
    //  Indice é maior que 0?
    
    while ((Indice > 0)) {
        
        //  índice inicio
        
        Indice = ebfIndexOf(TextoAux, "<!");
            
        //  Retirar tag
        
        TextoAux = ebfReplace(TextoAux, "<!", "xx");
            
        //  Inserir na lista de inicio
        
        ListaDeInicios = ebfSetElementAtList(ListaDeInicios, (Indice + 2), null);
            
        //  ínicio
        
        Inicio = (Indice + 2);
            
        //  índice fim
        
        Indice = ebfIndexOf(TextoAux, "!>");
            
        //  Retirar tag
        
        TextoAux = ebfReplace(TextoAux, "!>", "xx");
            
        //  Inserir na lista de fim
        
        ListaDeFinais = ebfSetElementAtList(ListaDeFinais, (Indice - Inicio), null);
            
        //  índice 
        
        Indice = ebfIndexOf(TextoAux, "<!");
        
    }
        
    //  Tamanho da lista
    
    TamanhoDaLista = ListaDeInicios.length;
        
    //  Acabou a lista?
    
    while ((!(Cont > TamanhoDaLista))) {
        
        //  Texto js
        
        TextoJavascript = ebfSubstring(TextoAux, ListaDeInicios[Cont-1], ListaDeFinais[Cont-1]);
            
        //  executar js
        
        Retorno = ebfExecuteJS(ebfReplaceAll(TextoJavascript, "\\\"", "\""));
            
        //  remover js do texto
        
        Texto = ebfReplace(Texto, ("<!" + TextoJavascript + "!>"), ((isNullOrEmpty(Retorno)) ? ("") : (Retorno)));
            
        //  cont++
        
        Cont = (Cont + 1);
        
    }
        
    //  Fim
    
    return (Texto);
    
}

