function GeralTabelaParaLista(Tabela, ListaComNomesDasColunas) {
    var QuantidadeDeColunas = 0;
    var Contador = 0;
    var ListaRetorno;
    var Sublista;
    
    
    
    Contador = 1;
        
    //  Criar lista de retorno
    
    ListaRetorno = new Array();
        
    //  Quantidade de colunas
    
    QuantidadeDeColunas = ListaComNomesDasColunas.length;
        
    //  Existem registros?
    
    while (ebfSQLEOF(Tabela)) {
        
        //  Criar sublista
        
        Sublista = new Array();
            
        //  Acabou a lista?
        
        while ((!(Contador > QuantidadeDeColunas))) {
            
            //  Inserir na lista
            
            Sublista = ebfSetElementAtList(Sublista, Tabela.field(ListaComNomesDasColunas[Contador-1], 'string'), null);
                
            //  Contador++
            
            Contador = (Contador + 1);
            
        }
            
        //  Adicionar na lista principal
        
        ListaRetorno = ebfSetElementAtList(ListaRetorno, Sublista, null);
            
        //  Iniciar contador
        
        Contador = 1;
            
        //  Próximo registro
        
        ebfSQLNext(Tabela);
        
    }
        
    //  Fim
    
    return (ListaRetorno);
    
}

