function NovaSofiaCriaTabelaCasoExistaContextos() {
    var QuantidadeDeContextos = 0;
    var Cont = 0;
    var ListaDeContextos;
    var ReferenciaDaDivFriends;
    var Integracaoframe;
    var Body;
    var Style;
    
    
    
    Cont = 1;
        
    //  Nova sofia - Consultar contextos
    
    ListaDeContextos = NovaSofiaConsultarContextos(null);
        
    //  Quantidade de contextos
    
    QuantidadeDeContextos = ListaDeContextos.length;
        
    //  Existem contextos?
    
    if ((QuantidadeDeContextos > 0)) {
        
        //  integracaoFrame
        
        Integracaoframe = ebfHtmlChildNodes(ebfHtmlGetElementById("Integracao"))[1-1];
            
        //  body
        
        Body = ebfHtmlGetParent(ebfIntegracaoGetElementById("Integracao", "chatbox"));
            
        //  Obter referência da div friends
        
        ReferenciaDaDivFriends = ebfIntegracaoGetElementById("Integracao", "friends");
            
        //  Limpar lista de contextos
        
        ebfHtmlInnerHtml(ReferenciaDaDivFriends, null);
            
        //  Acabou a lista?
        
        while ((!(Cont > QuantidadeDeContextos))) {
            
            //  Nova Sofia - Cria tabela caso exista contextos agendado
            
            NovaSofiaCriaTabelaCasoExistaContextosAgendado(ReferenciaDaDivFriends, ListaDeContextos[Cont-1], Integracaoframe)
                
            //  Cont++
            
            Cont = (Cont + 1);
            
        }
            
        //  css animate é nulo?
        
        if (isNullOrEmpty(ebfIntegracaoGetElementById("Integracao", "css_animate"))) {
            
            //  criar style
            
            Style = ebfHtmlCreateHtmlElement("style", ebfListParamsCreate(ebfListParamsCreate("type", "text/css"), ebfListParamsCreate("id", "css_animate")), null);
                
            //  anexar style
            
            ebfHtmlAppendElementAtPosition(Body, Style, 1);
                
            //  importar css
            
            ebfHtmlInnerHtml(Style, ebfGetLocalVariable("vCssContextos"));
                
            //  Fim
            
            return;
            
        } else {
            
            //  referência do style
            
            Style = ebfIntegracaoGetElementById("Integracao", "css_animate");
                
            //  importar css
            
            ebfHtmlInnerHtml(Style, ebfGetLocalVariable("vCssContextos"));
                
            //  Fim
            
            return;
            
        }
    } else {
        
        //  Fim
        
        return;
        
    }
}

function NovaSofiaCriaTabelaCasoExistaContextosAgendado(ReferenciaDaDivFriends, Sublista, Integracaoframe) {
    var Css = "";
    var Nome = "";
    var Icone = "";
    var Div;
    var ReferenciaP;
    var Descricao = "";
    var Id = 0;
    var Top = 0;
    var Data = "";
    
    //  obter nome do contexto
    
    Nome = Sublista[2-1];
        
    //  obter nome do icone
    
    Icone = Sublista[6-1];
        
    //  obter descrição
    
    Descricao = Sublista[7-1];
        
    //  id
    
    Id = Sublista[1-1];
        
    //  criar div friend
    
    Div = ebfHtmlCreateHtmlElement("div", ebfListParamsCreate(ebfListParamsCreate("class", "friend")), ReferenciaDaDivFriends);
        
    //  Associar evento onclick
    
    ebfHtmlAttachFlowEvent(Div,"click",reduceVariable("Nova Sofia - Ao selecionar contexto"),ebfListParamsCreate(Id, Sublista[5-1], Sublista[4-1], Nome, Descricao),false);
        
    //  Icone
    
    Icone = ((isNullOrEmpty(Icone)) ? ("data:image/png;base64,") : (Icone));
        
    //  criar img
    
    ebfHtmlCreateHtmlElement("img", ebfListParamsCreate(ebfListParamsCreate("src", Icone), ebfListParamsCreate("id", Id)), Div);
        
    //  obter top da imagem
    
    Top = ebfExecuteJSFromWindow(Integracaoframe, ebfReplaceAll("document.getElementById(\'\#\#ID\').getBoundingClientRect().top;", "\#\#ID", Id));
        
    //  css
    
    Css = ebfReplaceAll(ebfReplaceAll(".animate\#\#ID {\n  height: 40px;\n  width: 40px;\n  animation: example\#\#ID 0.3s;\n  position:absolute;\n  top:6px;\n  left:37px;\n}\n\n/* Safari 4.0 - 8.0 */\n@-webkit-keyframes example\#\#ID {\n    0%   {left:12px; top:\#\#TOPpx;}  \n   100%  {left:37px; top:6px;}\n}\n\n/* Standard syntax */\n@keyframes example\#\#ID {\n    0%   {left:12px; top:\#\#TOPpx;}  \n   100%  {left:37px; top:6px;}  \n}\n\n.animatevolta\#\#ID {\n  height: 40px;\n  width: 40px;\n  animation: examplevolta\#\#ID 0.3s;\n  position:absolute;\n  top:\#\#TOPpx !important;\n  left:12px !important;\n}\n\n/* Safari 4.0 - 8.0 */\n@-webkit-keyframes examplevolta\#\#ID {\n       0%  {left:37px; top:6px;}    \n   100%   {left:12px; top:\#\#TOPpx;}  \n  \n}\n\n/* Standard syntax */\n@keyframes examplevolta\#\#ID {\n       0%  {left:37px; top:6px;}     \n  100%   {left:12px; top:\#\#TOPpx;}  \n   \n}\n", "\#\#ID", Id), "\#\#TOP", Top);
        
    //  Definir css
    
    ebfSetLocalVariable("vCssContextos", (ebfGetLocalVariable("vCssContextos") + Css));
        
    //  criar p
    
    ReferenciaP = ebfHtmlCreateHtmlElement("p", null, Div);
        
    //  data
    
    Data = ((isNullOrEmpty(Sublista[8-1])) ? ("") : (ebfFormatDateTime(Sublista[8-1], "dd/MM/yyyy k:mm:ss")));
        
    //  definir conteudo de p
    
    ebfHtmlInnerHtml(ReferenciaP, ("<strong>" + Nome + "</strong><br><span>" + Descricao + "</span><br><time>" + Data + "</time>"));
        
    //  Fim
    
    return;
    
}

