function NovaSofiaMontarListaDePerguntas() {
    var ListaDePerguntas;
    var TamanhoDaLista = 0;
    var Cont = 0;
    var Json;
    var Valor = "";
    var Select;
    var Option;
    
    
    
    Cont = 1;
        
    //  select
    
    Select = ebfIntegracaoGetElementById("Integracao", "lista");
        
    //  limpar select
    
    ebfHtmlInnerHtml(Select, null);
        
    //  option
    
    Option = ebfHtmlCreateHtmlElement("option", null, Select);
        
    //  definir conteudo do option
    
    ebfHtmlInnerHtml(Option, "");
        
    //  Obter shared preferences
    
    Json = /* NOT FOUND */ebfGetAllPreferences(ebfToString(ebfGetSessionAttribute("idcontexto", false)));
        
    //  Json é nulo ou vazio?
    
    if (isNullOrEmpty(Json)) {
        
        //  Desabilitar lista de perguntas
        
        ebfHtmlSetDOMAttribute(Select, "disabled", "true");
            
        //  Fim
        
        return;
        
    } else {
        
        //  Criar objeto json
        
        Json = ebfCreateObjectJSON(Json);
            
        //  Obter lista de perguntas
        
        ListaDePerguntas = ebfGetValueObjectJson(Json, "perguntas");
            
        //  Tamanho da lista
        
        TamanhoDaLista = ListaDePerguntas.length;
            
        //  Acabou a lista?
        
        while ((!(Cont > TamanhoDaLista))) {
            
            //  Valor
            
            Valor = ListaDePerguntas[Cont-1];
                
            //  option
            
            Option = ebfHtmlCreateHtmlElement("option", ebfListParamsCreate(ebfListParamsCreate("value", Valor)), Select);
                
            //  definir conteudo do option
            
            ebfHtmlInnerHtml(Option, Valor);
                
            //  Cont++
            
            Cont = (Cont + 1);
            
        }
            
        //  Habilitar lista de perguntas
        
        ebfHtmlRemoveAttribute(Select, "disabled");
            
        //  Fim
        
        return;
        
    }
}

