function Sucesso(Imagem) {
    var ReferenciaDaDiv;
    var BotaoObterImagem;
    var Ref;
    
    //  Referencia do botão obter imagem
    
    BotaoObterImagem = ebfGetLocalVariable("ELEMENTO");
        
    //  É nulo ou vazio?
    
    if (isNullOrEmpty(Imagem)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Referência da div
        
        ReferenciaDaDiv = ebfHtmlChildNodes(ebfHtmlChildNodes(ebfHtmlGetParent(ebfHtmlGetParent(BotaoObterImagem)))[1-1])[1-1];
            
        //  Definir imagem
        
        ebfSetLocalVariable("IMAGEM", Imagem);
            
        //  Referencia do botão enviar
        
        Ref = ebfHtmlChildNodes(ebfHtmlGetParent(BotaoObterImagem))[2-1];
            
        //  Limpar moldura
        
        ebfHtmlInnerHtml(ReferenciaDaDiv, null);
            
        //  Adicionar imagem
        
        ebfHtmlCreateHtmlElement("img", ebfListParamsCreate(ebfListParamsCreate("src", Imagem), ebfListParamsCreate("style", "width:100% !important;\nborder-radius:0 !important;")), ReferenciaDaDiv);
            
        //  Ativar div da foto
        
        ebfHtmlCssDefineStyle(ReferenciaDaDiv, "display", "block");
            
        //  Fim
        
        return;
        
    }
}

