    var Passport = "";
    var Sysmap;
    var Guidmap;
    var PassportMap;
    var UserDataMap;
    var Validation;
    
    //  Get map in the session
    
    Sysmap = ebfGetSessionAttribute("SYSMap", true);
        
    //  Get map Guid in the session
    
    Guidmap = ebfGetSessionAttribute("GUIDMap", false);
        
    //  Get passport
    
    Passport = ebfMapGetObject(Guidmap,GetSystemProperties().get("syscode"));
        
    //  Get passport Map
    
    PassportMap = ebfMapGetObject(Sysmap,GetSystemProperties().get("syscode"));
        
    //  Remove node Passport Map
    
