function DeleteRecordFromTableSqlDatabase(FormId, NewValues, OldValues, ListFields, RelationName) {
    var Index = 0;
    var Fields;
    var QtyComps = 0;
    var FieldName = "";
    var CurrentComponent;
    var FieldValue;
    var DmlCommand = "";
    var ParamValues;
    var WhereSentence = "";
    var CommandSql = "";
    var ParamFields;
    
    
    
    Index = 1;
        
    //  Get field list
    
    Fields = ebfMapKeys(NewValues);
        
    //  Qty fields
    
    QtyComps = Fields.length;
        
    //  Begin DML command
    
    DmlCommand = ("DELETE FROM " + RelationName);
        
    //  Init param values
    
    ParamValues = new Array();
        
    //  Has more fields?
    
    while ((Index <= QtyComps)) {
        
        //  Get field name
        
        FieldName = Fields[Index-1];
            
        //  Get field value
        
        FieldValue = ebfMapGetObject(NewValues,FieldName);
            
        //  Variable "Data Field" equal variable "pkey"?
        
        if (ebfSearchSubstring(ebfToString(ListFields), FieldName)) {
            
            //  Add param value
            
            ebfSetElementAtList(ParamValues, FieldValue, null);
                
            //  Index++
            
            Index = (Index + 1);
            
        } else {
            
            //  Index++
            
            Index = (Index + 1);
            
        }
    }
        
    //  Build WHERE script
    
    WhereSentence = BuildWhereScript(FormId, OldValues, ParamValues, Fields, ListFields);
        
    //  ADD Where DMLCommand
    
    DmlCommand = (DmlCommand + "\n" + WhereSentence);
        
    //  Command SQL!
    
    CommandSql = ((ebfSearchSubstring(DmlCommand, "WHERE")) ? (DmlCommand) : ((DmlCommand + ebfNewLine(1) + WhereSentence)));
        
    //  Execute SQL
    
    ExecuteSqlCommand(CommandSql, ParamValues, RelationName, ListFields)
        
    //  Fim
    
    return;
    
}

