function GetColumnProperty(TableName, Column, Property) {
    var TableInfo;
    var TableColumn;
    var Type = "";
    var Metadata;
    var ColumnMap;
    var Value = "";
    
    //  Get Metadata
    
    Metadata = ebfGetSessionAttribute("metadata", true);
        
    //  Get table map
    
    TableInfo = ebfMapGetObject(Metadata,"Table Info");
        
    //  Get table map
    
    TableColumn = ebfMapGetObject(TableInfo,TableName.toUpperCase());
        
    //  Is Null Map
    
    if (isNullOrEmpty(TableColumn)) {
        
        //  Fim
        
        return (null);
        
    } else {
        
        //  Skip to uppercase
        
        Column = trim(Column).toUpperCase();
            
        //  Is Null Map
        
        if (isNullOrEmpty(Column)) {
            
            //  Fim
            
            return (null);
            
        } else {
            
            //  Get column map
            
            ColumnMap = ebfMapGetObject(TableColumn,Column);
                
            //  Is Null Map
            
            if (isNullOrEmpty(ColumnMap)) {
                
                //  Fim
                
                return (null);
                
            } else {
                
                //  Get Property
                
                Value = ebfMapGetObject(ColumnMap,Property);
                    
                //  Fim
                
                return (Value);
                
            }
        }
    }
}

