function TypeField(Type, Value) {
    
    //  Exist '%'?
    
    if (ebfSearchSubstring(Value, "%")) {
        
        //  Fim
        
        return (Value);
        
    } else {
        
        //  Type is null or empty?
        
        if (isNullOrEmpty(Type)) {
            
            //  Fim
            
            return (Value);
            
        } else {
            
            //  Float?
            
            if (ebfSearchSubstring(Type.toLowerCase(), "float")) {
                
                //  Type Float
                
                Value = toDouble(Value);
                    
                //  Fim
                
                return (Value);
                
            } else {
                
                //  Integer?
                
                if (ebfSearchSubstring(Type.toLowerCase(), "integer")) {
                    
                    //  Type Integer
                    
                    Value = toLong(Value);
                        
                    //  Fim
                    
                    return (Value);
                    
                } else {
                    
                    //  Date, Time or Timestamp?
                    
                    if ((ebfSearchSubstring(Type.toLowerCase(), "date") || ebfSearchSubstring(Type.toLowerCase(), "time") || ebfSearchSubstring(Type.toLowerCase(), "datetime"))) {
                        
                        //  Fim
                        
                        return (Value);
                        
                    } else {
                        
                        //  Is Boolean?
                        
                        if (ebfSearchSubstring(Type.toLowerCase(), "boolean")) {
                            
                            //  Type Boolean
                            
                            Value = parseBoolean(Value);
                                
                            //  Fim
                            
                            return (Value);
                            
                        } else {
                            
                            //  Text?
                            
                            if (ebfSearchSubstring(Type.toLowerCase(), "string")) {
                                
                                //  Type Varchar
                                
                                Value = ebfToString(Value);
                                    
                                //  Fim
                                
                                return (Value);
                                
                            } else {
                                
                                //  Fim
                                
                                return (Value);
                                
                            }
                        }
                    }
                }
            }
        }
    }
}

