function AlterKeyMap(MapColumn) {
    var ListColumnInput;
    var Count = 0;
    var KeyMapInput = "";
    var ColumnName = "";
    var MapResult;
    var ValueMap = "";
    
    
    
    Count = 1;
        
    //  Create Out Map
    
    MapResult = ebfMapCreateObject();
        
    //  Get Key List Map Input
    
    ListColumnInput = ebfMapKeys(MapColumn);
        
    //  Exist Element?
    
    while ((Count <= ListColumnInput.length)) {
        
        //  Get Key Map Input
        
        KeyMapInput = ListColumnInput[Count-1];
            
        //  Get Value from Key Map
        
        ValueMap = ebfMapGetObject(MapColumn,KeyMapInput);
            
        //  IsFunction?
        
        if (ebfSearchSubstring(KeyMapInput, ":FUNCAO_")) {
            
            //  Alter Key Map
            
            ColumnName = trim(ebfReplace(KeyMapInput, ":FUNCAO_/", ""));
                
            //  Next Element
            
            Count = (Count + 1);
                
            //  Add element frm Out Map 
            
            ebfMapAddObject(MapResult, ColumnName, ValueMap);
            
        } else {
            
            //  Set Key Map
            
            ColumnName = KeyMapInput;
                
            //  Next Element
            
            Count = (Count + 1);
                
            //  Add element frm Out Map 
            
            ebfMapAddObject(MapResult, ColumnName, ValueMap);
            
        }
    }
        
    //  Fim
    
    return (MapResult);
    
}

