function GetNameQueryFilter(Sql, FunctionName, InputColumn) {
    var ListLines;
    var Count = 0;
    var CurrentLine = "";
    var ParameterReturn = "";
    
    
    
    Count = 1;
        
    //  Get List Filter
    
    ListLines = ebfSplit(Sql,  "\n" );
        
    //  Exist element in the list?
    
    while ((ListLines.length >= Count)) {
        
        //  Get line from query
        
        CurrentLine = ListLines[Count-1];
            
        //  Is Function?
        
        if (ebfSearchSubstring(CurrentLine, trim(FunctionName))) {
            
            //  Get column name
            
            ParameterReturn = ebfSubstring(CurrentLine, 1, (ebfIndexOf(CurrentLine, ":FUNCAO_") - 1));
                
            //  Format field
            
            ParameterReturn = trim(ebfReplaceAll(ebfReplaceAll(ParameterReturn, "(", ""), ")", ""));
                
            //  This column has not been compared
            
            if ((isNullOrEmpty(InputColumn) || (trim(InputColumn) != trim(ParameterReturn)))) {
                
                //  Stop while
                
                Count = ListLines.length;
                    
                //  Next element
                
                Count = (Count + 1);
                
            } else {
                
                //  Next element
                
                Count = (Count + 1);
                
            }
        } else {
            
            //  Next element
            
            Count = (Count + 1);
            
        }
    }
        
    //  Fim
    
    return (ParameterReturn);
    
}

