function ParseParameters(Filter) {
    var GuidForm = "";
    var Auxlist1;
    var Counter = 0;
    var ReturnList = "";
    var Auxlist2;
    var Value = "";
    
    
    
    Counter = 1;
        
    //  GUID
    
    GuidForm = formGUID;
        
    //  AuxList1
    
    Auxlist1 = ebfSplit(trim(Filter), ebfNewLine(1));
        
    //  exist fields?
    
    while ((Auxlist1.length >= Counter)) {
        
        //  AuxList2
        
        Auxlist2 = ebfSplit(Auxlist1[Counter-1], "=");
            
        //  Component?
        
        if (ebfSearchSubstring(Auxlist2[2-1], "{")) {
            
            //  Value
            
            Value = ebfFormGetComponentValue(ebfReplaceAll(ebfReplaceAll(Auxlist2[2-1], "{", ""), "}", ""));
                
            //  Return List
            
            ReturnList = (ReturnList + (Auxlist2[1-1] + "=" + Value + (((Auxlist1.length >= (Counter + 1))) ? (";") : (""))));
                
            //  Counter++!
            
            Counter = (Counter + 1);
            
        } else {
            
            //  Value
            
            Value = ebfSQLGetFormField(Auxlist2[2-1]);
                
            //  Return List
            
            ReturnList = (ReturnList + (Auxlist2[1-1] + "=" + Value + (((Auxlist1.length >= (Counter + 1))) ? (";") : (""))));
                
            //  Counter++!
            
            Counter = (Counter + 1);
            
        }
    }
        
    //  Fim
    
    return (ReturnList);
    
}

