function GetFilterFromQuery(Query) {
    var ListParameters;
    var Count = 0;
    var Parameter = "";
    var Values = "";
    var MapFilter;
    var FilterColumn = "";
    var Filter = "";
    
    
    
    Count = 1;
        
    //  Create Map Filter
    
    MapFilter = ebfMapCreateObject();
        
    //  Get SQL Parameters
    
    ListParameters = GetParameterSql(Query);
        
    //  Exist element?
    
    while ((Count <= ListParameters.length)) {
        
        //  Get Parameter
        
        Parameter = ListParameters[Count-1];
            
        //  IsFunction?
        
        if (ebfSearchSubstring(Parameter, ":FUNCAO_")) {
            
            //  Get Parameters Value
            
            Values = GetParameters(Parameter);
                
            //  Get Name Query Filter
            
            FilterColumn = GetNameQueryFilter(Query, Parameter, FilterColumn);
                
            //  Get Filter
            
            Filter = ebfSubstring(FilterColumn, (FilterColumn.length - 1), FilterColumn.length);
                
            //  Add Map Filter
            
            ebfMapAddObject(MapFilter, (":FUNCAO_" + "/" + trim(ebfSubstring(FilterColumn, 1, (FilterColumn.length - 1))) + trim(Filter) + "?"), Values);
                
            //  Format Query
            
            Query = ebfReplace(Query, Parameter, " ?FUNCTION? ");
                
            //  Next Parameter
            
            Count = (Count + 1);
            
        } else {
            
            //  Next Parameter
            
            Count = (Count + 1);
            
        }
    }
        
    //  Add Map Filter
    
    ebfMapAddObject(MapFilter, "SQL", Query);
        
    //  Fim
    
    return (MapFilter);
    
}

