function GetRequestFilters(ParameterDefault, MapDefaultValues) {
    var ListParameterDefault;
    var Count = 0;
    var Element = "";
    var Column = "";
    var Values = "";
    
    
    
    Count = 1;
        
    //  More than one parameter?
    
    if (ebfSearchSubstring(ParameterDefault, ";")) {
        
        //  Get List Parameter
        
        ListParameterDefault = ebfSplit(ParameterDefault, ";");
            
        //  Exist element from list?
        
        while ((Count <= ListParameterDefault.length)) {
            
            //  Get Element
            
            Element = ebfToString(ListParameterDefault[Count-1]);
                
            //  Get Column
            
            Column = ebfToString(ebfSplit(Element, "=")[1-1]);
                
            //  Get Values
            
            Values = trim(ebfSplit(Element, "=")[2-1]);
                
            //  Column format if exist table.column
            
            Column = ((ebfSearchSubstring(Column, ".")) ? (ebfSplit(Column, ".")[2-1]) : (Column));
                
            //  Set Map Default Values
            
            ebfMapAddObject(MapDefaultValues, Column, Values);
                
            //  Next Element
            
            Count = (Count + 1);
            
        }
            
        //  Fim
        
        return (MapDefaultValues);
        
    } else {
        
        //  Get Column
        
        Column = ebfToString(ebfSplit(ParameterDefault, "=")[1-1]);
            
        //  Column format if exist table.column
        
        Column = ((ebfSearchSubstring(Column, ".")) ? (ebfSplit(Column, ".")[2-1]) : (Column));
            
        //  Get value
        
        Values = ebfSplit(ParameterDefault, "=")[2-1];
            
        //  Set Map Default Values
        
        ebfMapAddObject(MapDefaultValues, trim(Column), trim(Values));
            
        //  Fim
        
        return (MapDefaultValues);
        
    }
}

