        //  Close Parent
        
        parent.callFunction(parent.getParentWindow(window), reduceVariable("Close Parent Form"), null);
            
        //  Close current form
        
        parent.closeView(formGUID);
            
        //  Save mode (session)
        
        ebfSetSessionAttribute((Search + "modesearch"), "", false);
            
