function GetComponentDataset(ComponentName) {
    var Query = "";
    var ListParameters;
    var ListResult;
    var Count = 0;
    var Parameter = "";
    var Values = "";
    var QueryResult;
    
    
    
    Count = 1;
        
    //  Create List
    
    ListResult = new Array();
        
    //  Get Query from Component
    
    Query = GetComponentProperty(formGUID, ComponentName, "SQL");
        
    //  Get SQL Parameters
    
    ListParameters = GetParameterSql(Query);
        
    //  Exist element?
    
    while ((Count <= ListParameters.length)) {
        
        //  Get Parameter
        
        Parameter = ListParameters[Count-1];
            
        //  Is Component?
        
        if ((ebfSearchSubstring(Parameter.toLowerCase(), ":componente_") || ebfSearchSubstring(Parameter.toLowerCase(), ":component_"))) {
            
            //  Get Not DBAware Component
            
            Values = GetNotDbWhereComponent(Parameter);
                
            //  Add Value in the list
            
            ebfSetElementAtList(ListResult, Values, null);
                
            //  Next Parameter
            
            Count = (Count + 1);
                
            //  Format Query
            
            Query = ebfReplace(Query, Parameter, "?");
            
        } else {
            
            //  Get Parameters Value
            
            Values = GetParameters(Parameter);
                
            //  Add Value in the list
            
            ebfSetElementAtList(ListResult, Values, null);
                
            //  Next Parameter
            
            Count = (Count + 1);
                
            //  Format Query
            
            Query = ebfReplace(Query, Parameter, "?");
            
        }
    }
        
    //  Execute Query
    
    QueryResult = ExecuteQuery(Query, ebfMapCreateObject(), ListResult);
        
    //  Fim
    
    return (QueryResult);
    
}

