function ShowDefaultValues(DefaultParameterFilter) {
    var FormId = "";
    var DefaultValues;
    var MapDefaults;
    var Counter = 0;
    var Field = "";
    var ComponentsList;
    var DataField = "";
    var FieldDefaultValue = "";
    var ComponentType = "";
    var MapFilterDefault;
    
    
    
    Counter = 1;
        
    //  Get form property "FNT_SQLDEFAULT"
    
    DefaultValues = GetFormProperty(FormId, "FNT_SQLDEFAULT");
        
    //  Create Map
    
    MapDefaults = ebfMapCreateObject();
        
    //  Get current form
    
    FormId = formGUID;
        
    //  Get Default Values Registered
    
    MapDefaults = GetDefaultValuesRegistered(FormId);
        
    //  Get request filters
    
    MapDefaults = GetRequestFilters(DefaultParameterFilter, MapDefaults);
        
    //  Convert the variable "Default Values " to the list
    
    DefaultValues = ((isNullOrEmpty(DefaultValues)) ? (new Array()) : (ebfSplit(DefaultValues, ebfNewLine(1))));
        
    //  End of the list?
    
    while ((!(Counter > DefaultValues.length))) {
        
        //  Get element from the list of standard values
        
        Field = DefaultValues[Counter-1];
            
        
        
        if (isNullOrEmpty(ebfMapGetObject(MapDefaults,ebfSubstring(Field, 1, (ebfIndexOf(Field, "=") - 1))))) {
            
            //  Adds value to the map
            
            ebfMapAddObject(MapDefaults, ebfSubstring(Field, 1, (ebfIndexOf(Field, "=") - 1)), ebfSubstring(Field, (ebfIndexOf(Field, "=") + 1), Field.length));
                
            //  Increment Counter used to run over the component list
            
            Counter = (Counter + 1);
            
        } else {
            
            //  Increment Counter used to run over the component list
            
            Counter = (Counter + 1);
            
        }
    }
        
    //  Get form property
    
    ComponentsList = GetFormProperty(FormId, "Components");
        
    //  Mount component list based in keys of hashmap
    
    ComponentsList = ebfMapKeys(ComponentsList);
        
    //  Reset Counter to be used in next loop
    
    Counter = 1;
        
    //  End of the list?
    
    while ((!(Counter > ComponentsList.length))) {
        
        //  Get Component Property
        
        DataField = GetComponentProperty(FormId, ComponentsList[Counter-1], "Campo");
            
        //  Get Component Type
        
        ComponentType = GetComponentType(FormId, ComponentsList[Counter-1]);
            
        //  Variable "Data Field" is null?
        
        if (isNullOrEmpty(DataField)) {
            
            //  Type = 'K'?
            
            if ((ComponentType == "K")) {
                
                //  Mount Dynamic Component List
                
                MountDynamicComponentList(GetComponentProperty(FormId, ComponentsList[Counter-1], "Campo"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoChave"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoLista"), GetComponentProperty(FormId, ComponentsList[Counter-1], "SQL"), ComponentsList[Counter-1], FieldDefaultValue, FormId)
                    
                //  Increment Counter used to run over the component list
                
                Counter = (Counter + 1);
                
            } else {
                
                //  Increment Counter used to run over the component list
                
                Counter = (Counter + 1);
                
            }
        } else {
            
            //  Get default value for the field obtained
            
            FieldDefaultValue = ebfMapGetObject(MapDefaults,DataField);
                
            //  Variable "Field default value" is null?
            
            if (isNullOrEmpty(FieldDefaultValue)) {
                
                //  Type = 'K'?
                
                if ((ComponentType == "K")) {
                    
                    //  Mount Dynamic Component List
                    
                    MountDynamicComponentList(GetComponentProperty(FormId, ComponentsList[Counter-1], "Campo"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoChave"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoLista"), GetComponentProperty(FormId, ComponentsList[Counter-1], "SQL"), ComponentsList[Counter-1], FieldDefaultValue, FormId)
                        
                    //  Increment Counter used to run over the component list
                    
                    Counter = (Counter + 1);
                    
                } else {
                    
                    //  Increment Counter used to run over the component list
                    
                    Counter = (Counter + 1);
                    
                }
            } else {
                
                //  Type = 'K'?
                
                if ((ComponentType == "K")) {
                    
                    //  Mount Dynamic Component List
                    
                    MountDynamicComponentList(GetComponentProperty(FormId, ComponentsList[Counter-1], "Campo"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoChave"), GetComponentProperty(FormId, ComponentsList[Counter-1], "CampoLista"), GetComponentProperty(FormId, ComponentsList[Counter-1], "SQL"), ComponentsList[Counter-1], FieldDefaultValue, FormId)
                        
                    //  Increment Counter used to run over the component list
                    
                    Counter = (Counter + 1);
                    
                } else {
                    
                    //  Show field value on the component obtained from component list
                    
                    ebfFormChangeComponentValue(ComponentsList[Counter-1], FieldDefaultValue);
                        
                    //  Increment Counter used to run over the component list
                    
                    Counter = (Counter + 1);
                    
                }
            }
        }
    }
        
    //  Fim
    
    return;
    
}

