function LoadEventsForm(Event) {
    var MapEvents;
    var RuleName = "";
    var Params = "";
    var ListValues;
    var ListParams;
    var CountListParams = 0;
    var ParamsAndValue = "";
    var FormId = "";
    var Value = "";
    
    
    
    CountListParams = 1;
        
    //  Lower Event
    
    Event = Event.toLowerCase();
        
    //  Get Guid Form
    
    FormId = formGUID;
        
    //  Get Events Property
    
    MapEvents = GetEventsProperty(FormId, Event);
        
    //  Exist Map?
    
    if (isNullOrEmpty(MapEvents)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Get Rule Name
        
        RuleName = ebfMapGetObject(MapEvents,(Event + "rulename"));
            
        //  Rule Name Is Null?
        
        if (isNullOrEmpty(RuleName)) {
            
            //  Fim
            
            return;
            
        } else {
            
            //  Create List Values
            
            ListValues = new Array();
                
            //  Get Params
            
            Params = ebfMapGetObject(MapEvents,(Event + "params"));
                
            //  Params Is Null?
            
            if (isNullOrEmpty(Params)) {
                
                //  Run Rule
                
                ebfFlowExecute(RuleName, ListValues);
                    
                //  Fim
                
                return;
                
            } else {
                
                //  Create List Params
                
                ListParams = ebfSplit(Params, ";");
                    
                //  Count <= Size List Params
                
                while ((CountListParams <= ListParams.length)) {
                    
                    //  Get Params And Value
                    
                    ParamsAndValue = ListParams[CountListParams-1];
                        
                    //  Get Value
                    
                    Value = ebfSplit(ParamsAndValue, "=")[2-1];
                        
                    //  Params And Value = Component?
                    
                    if ((ebfSubstring(Value, 1, 1) == "{")) {
                        
                        //  Remove " { " And " } "
                        
                        Value = ebfReplaceAll(ebfReplaceAll(Value, "{", null), "}", null);
                            
                        //  Get Value Component
                        
                        Value = ebfFormGetComponentValue(Value);
                            
                        //  Increment Count List Params
                        
                        CountListParams = (CountListParams + 1);
                            
                        //  Insert Value List
                        
                        ebfSetElementAtList(ListValues, Value, null);
                        
                    } else {
                        
                        //  Params And Value = Costant?
                        
                        if ((ebfSubstring(Value, 1, 1) == "\'")) {
                            
                            //  Remove " ' "
                            
                            Value = ebfReplaceAll(Value, "\'", null);
                                
                            //  Increment Count List Params
                            
                            CountListParams = (CountListParams + 1);
                                
                            //  Insert Value List
                            
                            ebfSetElementAtList(ListValues, Value, null);
                            
                        } else {
                            
                            //  Get Value Field
                            
                            Value = ebfSQLGetFormField(ebfSplit(ParamsAndValue, "=")[2-1]);
                                
                            //  Increment Count List Params
                            
                            CountListParams = (CountListParams + 1);
                                
                            //  Insert Value List
                            
                            ebfSetElementAtList(ListValues, Value, null);
                            
                        }
                    }
                }
                    
                //  Run Rule
                
                ebfFlowExecute(RuleName, ListValues);
                    
                //  Fim
                
                return;
                
            }
        }
    }
}

