function RetrieveGridDataset(ComponentName) {
    var ParentFormGuid = "";
    var Sql = "";
    var Params;
    var Counter = 0;
    var AuxList1;
    var Record;
    var Map;
    var AuxList2;
    var GuidForm = "";
    var NameComponent = "";
    
    
    
    Counter = 1;
        
    //  Get current form GUID
    
    ParentFormGuid = formGUID;
        
    //  Get Component Property (Parametros)
    
    Params = GetComponentProperty(ParentFormGuid, ComponentName, "Parametros");
        
    //  Get Component Property (Parametros)
    
    GuidForm = GetComponentProperty(ParentFormGuid, ComponentName, "CodigoForm");
        
    //  Convert to List
    
    Params = ConvertToList(Params);
        
    //  Get property (FNT_SQLSELECT)
    
    Sql = GetFormProperty(GuidForm, "FNT_SQLSELECT");
        
    //  Create Map!
    
    Map = ebfMapCreateObject();
        
    //  Is Function?
    
    if (ebfSearchSubstring(Sql, ":FUNCAO_")) {
        
        //  Get Filter from Query
        
        Map = GetFilterFromQuery(Sql);
            
        //  Get SQL Formated
        
        Sql = ebfMapGetObject(Map,"SQL");
            
        //  Remove SQL from Filter map
        
        ebfMapRemoveObject(Map,"SQL");
            
        //  filters?
        
        while ((Params.length >= Counter)) {
            
            //  is null?
            
            if (isNullOrEmpty(Params[Counter-1])) {
                
                //  counter++!
                
                Counter = (Counter + 1);
                
            } else {
                
                //  Aux List1
                
                AuxList1 = ebfSplit(Params[Counter-1], "=");
                    
                //  Aux List2
                
                AuxList2 = ebfSplit(AuxList1[1-1], ".");
                    
                //  Componnet?
                
                if (ebfSearchSubstring(AuxList1[2-1], "{")) {
                    
                    //  Component Name
                    
                    NameComponent = ebfReplaceAll(ebfReplaceAll(AuxList1[2-1], "{", ""), "}", "");
                        
                    //  Filter
                    
                    ebfMapAddObject(Map, (AuxList1[1-1] + "=?"), ConvertToFieldType(AuxList2[2-1], ebfFormGetComponentValue(NameComponent), AuxList2[1-1]));
                        
                    //  counter++!
                    
                    Counter = (Counter + 1);
                    
                } else {
                    
                    //  Filter
                    
                    ebfMapAddObject(Map, (AuxList1[1-1] + "=?"), ConvertToFieldType(AuxList2[2-1], ebfSQLGetFormField(AuxList1[2-1]), AuxList2[1-1]));
                        
                    //  counter++!
                    
                    Counter = (Counter + 1);
                    
                }
            }
        }
            
        //  Load Records From a Map Query
        
        Record = LoadRecordsFromAMapQuery(Sql, Map);
            
        //  Fim
        
        return (Record);
        
    } else {
        
        //  filters?
        
        while ((Params.length >= Counter)) {
            
            //  is null?
            
            if (isNullOrEmpty(Params[Counter-1])) {
                
                //  counter++!
                
                Counter = (Counter + 1);
                
            } else {
                
                //  Aux List1
                
                AuxList1 = ebfSplit(Params[Counter-1], "=");
                    
                //  Aux List2
                
                AuxList2 = ebfSplit(AuxList1[1-1], ".");
                    
                //  Componnet?
                
                if (ebfSearchSubstring(AuxList1[2-1], "{")) {
                    
                    //  Component Name
                    
                    NameComponent = ebfReplaceAll(ebfReplaceAll(AuxList1[2-1], "{", ""), "}", "");
                        
                    //  Filter
                    
                    ebfMapAddObject(Map, (AuxList1[1-1] + "=?"), ConvertToFieldType(AuxList2[2-1], ebfFormGetComponentValue(NameComponent), AuxList2[1-1]));
                        
                    //  counter++!
                    
                    Counter = (Counter + 1);
                    
                } else {
                    
                    //  Filter
                    
                    ebfMapAddObject(Map, (AuxList1[1-1] + "=?"), ConvertToFieldType(AuxList2[2-1], ebfSQLGetFormField(AuxList1[2-1]), AuxList2[1-1]));
                        
                    //  counter++!
                    
                    Counter = (Counter + 1);
                    
                }
            }
        }
            
        //  Load Records From a Map Query
        
        Record = LoadRecordsFromAMapQuery(Sql, Map);
            
        //  Fim
        
        return (Record);
        
    }
}

function CheckIfTheQueryIsBadFormatted(Sql) {
    
    //  Exist comment WHERE_NEW?
    
    if (ebfSearchSubstring(Sql, "/*WHERE_NEW*/")) {
        
        //  Exist Comment ORDER_NEW?
        
        if (ebfSearchSubstring(Sql, "/*ORDER_NEW*/")) {
            
            //  Fim
            
            return (true);
            
        } else {
            
            //  Exist Comment ORDER_ADD?
            
            if (ebfSearchSubstring(Sql, "/*ORDER_ADD*/")) {
                
                //  Fim
                
                return (true);
                
            } else {
                
                //  Fim
                
                return (false);
                
            }
        }
    } else {
        
        //  Exist comment WHERE_ADD?
        
        if (ebfSearchSubstring(Sql, "/*WHERE_ADD*/")) {
            
            //  Exist Comment ORDER_NEW?
            
            if (ebfSearchSubstring(Sql, "/*ORDER_NEW*/")) {
                
                //  Fim
                
                return (true);
                
            } else {
                
                //  Exist Comment ORDER_ADD?
                
                if (ebfSearchSubstring(Sql, "/*ORDER_ADD*/")) {
                    
                    //  Fim
                    
                    return (true);
                    
                } else {
                    
                    //  Fim
                    
                    return (false);
                    
                }
            }
        } else {
            
            //  Fim
            
            return (false);
            
        }
    }
}

