function InsertRecordIntoDatabase(FormId, NewValues, RelationName) {
    var Index = 0;
    var Fields;
    var FieldName = "";
    var FieldValue;
    var DmlCommand = "";
    var ParamValues;
    var Keys;
    var IndexFiledList = 0;
    var Filter = "";
    var ListFilter;
    var MapsColumnsTable = "";
    
    
    
    Index = 1;
        
    //  Create list filter
    
    ListFilter = new Array();
        
    //  Get field list
    
    Fields = ebfMapKeys(NewValues);
        
    //  Init param values
    
    ParamValues = new Array();
        
    //  Get Column Name
    
    MapsColumnsTable = GetColumnName(RelationName);
        
    //  Has more fields?
    
    while ((Index <= Fields.length)) {
        
        //  Get field name
        
        FieldName = Fields[Index-1];
            
        //  Is Name exist from map column?
        
        if ((!isNullOrEmpty(ebfMapGetObject(MapsColumnsTable,FieldName.toUpperCase())))) {
            
            //  Get field value
            
            FieldValue = ebfMapGetObject(NewValues,FieldName);
                
            //  Is null value?
            
            if (isNullOrEmpty(FieldValue)) {
                
                //  Get element index from list
                
                IndexFiledList = listContainsObject(Fields,FieldName);
                    
                //  Remove element from list
                
                Fields.splice((IndexFiledList-1), 1);
                
            } else {
                
                //  Add field to INSERT SQL
                
                Filter = (Filter + "?");
                    
                //  Add ? list FilterC
                
                ebfSetElementAtList(ListFilter, "?", null);
                    
                //  Add param value
                
                ebfSetElementAtList(ParamValues, FieldValue, null);
                    
                //  Index++
                
                Index = (Index + 1);
                
            }
        } else {
            
            //  Remove element from list (Fields)V
            
            Fields.splice((listContainsObject(Fields,FieldName)-1), 1);
            
        }
    }
        
    //  Begin DML command
    
    DmlCommand = ("INSERT INTO " + RelationName + " (" + ebfListImplode(Fields, ",") + ") VALUES (" + ebfListImplode(ListFilter, ",") + ")");
        
    //  Exist element in the list?
    
    if ((ParamValues.length >= 1)) {
        
        //  Execute SQL
        
        ExecuteSqlCommand(DmlCommand, ParamValues, RelationName, Fields)
            
        //  Fim
        
        return (Keys);
        
    } else {
        
        //  Fim
        
        return (Keys);
        
    }
}

