function SyncObterValoresDosCampos(Dados, Campos, Servidor) {
    var Contadorcampo = 0;
    var Formatedvalue = "";
    var Datatype = "";
    var Fieldname = "";
    var Fieldvalue;
    var Fieldqty = 0;
    var ListOfFiles;
    var FileOpenRead;
    var ContentFile;
    var ShortSystemName = "";
    var Url;
    var FileGuid = "";
    
    
    
    Contadorcampo = 1;
        
    //  Get the Short System Name
    
    ShortSystemName = GetSystemProperties().get("syscode");
        
    //   Inicializo a variavel!
    
    Formatedvalue = "{";
        
    //  Field Qty
    
    Fieldqty = Campos.length;
        
    //  Criar Objeto Lista
    
    ListOfFiles = new Array();
        
    //  Tamanho da lista é menor ou igual ao contador?
    
    while ((Contadorcampo <= Fieldqty)) {
        
        //  Get data type
        
        Datatype = Campos[Contadorcampo-1][2-1].toUpperCase();
            
        //  Get field name
        
        Fieldname = Campos[Contadorcampo-1][1-1];
            
        //  Field value
        
        Fieldvalue = Dados.field(Fieldname, 'string');
            
        //  Label
        
         Formatedvalue =   Formatedvalue + Fieldname + ":";
            
        //  Is Empty or Null?
        
        if (((Fieldvalue == "undefined") || isNullOrEmpty(Fieldvalue))) {
            
            //  Value null
            
             Formatedvalue =   Formatedvalue + "null";
                
            //  Last Item?
            
             Formatedvalue =   Formatedvalue + (((Contadorcampo < Fieldqty)
            ) ? (",") : ("}"));
                
            //  Incremento o contador!
            
            Contadorcampo = (Contadorcampo + 1);
            
        } else {
            
            //  Integer?
            
            if ((Datatype == "INTEGER")) {
                
                //  Add INT value
                
                 Formatedvalue =   Formatedvalue + Fieldvalue;
                    
                //  Last Item?
                
                 Formatedvalue =   Formatedvalue + (((Contadorcampo < Fieldqty)
                ) ? (",") : ("}"));
                    
                //  Incremento o contador!
                
                Contadorcampo = (Contadorcampo + 1);
                
            } else {
                
                //  Is a file reference?
                
                if ((ebfSearchSubstring(Fieldvalue, "content://") || ebfSearchSubstring(Fieldvalue, "file://") || ebfSearchSubstring(Fieldvalue, "local://"))) {
                    
                    //  Gerar File GUID
                    
                    FileGuid = ebfGenerateGUID();
                        
                    //  Enviar arquivo binário via fluxo web
                    
                    ebfSendFilePOST((Servidor + "/SyncGravarArquivo.rule"), ebfMapCreateFromList(ebfListParamsCreate("sys", "MSC"), ebfListParamsCreate("SiglaSistema", ShortSystemName), ebfListParamsCreate("FileName", FileGuid)), ebfMapCreateFromList(ebfListParamsCreate("bin", Fieldvalue)));
                        
                    //  Atribuir File GUID para FieldValue
                    
                    Fieldvalue = FileGuid;
                        
                    //  Add ESCAPED value
                    
                     Formatedvalue =   Formatedvalue + ("\"" + Fieldvalue + "\"");
                        
                    //  Last Item?
                    
                     Formatedvalue =   Formatedvalue + (((Contadorcampo < Fieldqty)
                    ) ? (",") : ("}"));
                        
                    //  Incremento o contador!
                    
                    Contadorcampo = (Contadorcampo + 1);
                    
                } else {
                    
                    //  Add ESCAPED value
                    
                     Formatedvalue =   Formatedvalue + ("\"" + Fieldvalue + "\"");
                        
                    //  Last Item?
                    
                     Formatedvalue =   Formatedvalue + (((Contadorcampo < Fieldqty)
                    ) ? (",") : ("}"));
                        
                    //  Incremento o contador!
                    
                    Contadorcampo = (Contadorcampo + 1);
                    
                }
            }
        }
    }
        
    //  Fim
    
    return (Formatedvalue);
    
}

function SyncObterListaDeImagens(Url, InterationUser, DataReceived) {
    var ListaDeArquivos;
    var Contador = 0;
    var NomeDoArquivo = "";
    var Arquivo;
    var ListaString = "";
    
    
    
    Contador = 1;
        
    //  String de Retorno
    
    ListaString = ebfGetURLContent(Url);
        
    //  é nulo?
    
    if (isNullOrEmpty(ListaString)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Obter Lista de Arquivo!
        
        ListaDeArquivos = ebfSplit(ListaString, ",");
            
        //  Lista >= Tamanho?
        
        while ((ListaDeArquivos.length >= Contador)) {
            
            //  é nulo?
            
            if (isNullOrEmpty(ListaDeArquivos[Contador-1])) {
                
                //  Contador++!
                
                Contador = (Contador + 1);
                
            } else {
                
                //  Nome do Arquivo!
                
                NomeDoArquivo = trim(ebfSubstring(ListaDeArquivos[Contador-1], (ebfLastIndexOf(ListaDeArquivos[Contador-1], "/") + 1), ListaDeArquivos[Contador-1].length));
                    
                //  Existe o arquivo?
                
                if (ebfSearchSubstring(DataReceived, NomeDoArquivo)) {
                    
                    //  Baixar o arquivo da URL
                    
                    ebfIOSDownloadURLContent(trim(ListaDeArquivos[Contador-1]), NomeDoArquivo);
                        
                    //  Contador++!
                    
                    Contador = (Contador + 1);
                    
                } else {
                    
                    //  Contador++!
                    
                    Contador = (Contador + 1);
                    
                }
            }
        }
            
        //  Fim
        
        return;
        
    }
}

