function CheckIfTheUserExistsInDatabase(Login, Password) {
    var TableUser;
    var Passwordmd5 = "";
    
    //  Get query
    
    TableUser = ebfSQLExecuteQuery("\nSelect\n  fr_usuario.usr_login,\n  fr_usuario.usr_senha,\n  fr_usuario.usr_codigo\nFrom\n  fr_usuario\nWhere\n  (fr_usuario.usr_login = ?)\n\n\n", [Login], null);
        
    //  Exist record in the query?
    
    if (ebfSQLEOF(TableUser)) {
        
        //  Password to convert md5
        
        Passwordmd5 = ebfTextMD5((TableUser.field("usr_codigo", 'string') + trim(Password)));
            
        //  Password is valid?
        
        if ((trim(TableUser.field("usr_senha", null)) == trim(Passwordmd5))) {
            
            //  Fim
            
            return (true);
            
        } else {
            
            //  Fim
            
            return (false);
            
        }
    } else {
        
        //  Fim
        
        return (false);
        
    }
}

