                    Tablelist = ebfSplit(ebfGetURLContent(((trim(Server) + "/Sync%20-%20Obter%20lista%20tabelas.rule?sys=MSC&&SiglaSistema=") + trim(GetSystemProperties().get("syscode")))), ",");
                        
