function SyncEfetuarRollbackDuranteAExcecao(Mensagem, Causa) {
    
    //  Rollback Transaction
    
    ebfSQLRollbackTransaction(null);
        
    //  Fim
    
    return;
    
}

function SyncAtualizarTabela(Tablename, Inserts) {
    var Table;
    var Datareceived = "";
    var Records;
    var Recordcount = 0;
    var InsertList;
    
    
    
    Recordcount = 1;
        
    //  Remove os registros
    
    ebfSQLExecuteUpdate(("DELETE FROM " + Tablename), null);
        
    //  Separo os comandos!
    
    Records = ebfSplit(Inserts, "\#\#");
        
    //  Existem comandos a executar?
    
    while ((Recordcount < Records.length)
    ) {
        
        //  Executo o comando de insersão!
        
        ebfSQLExecuteUpdate(Records[Recordcount-1], null);
            
        //  Incremento contador!
        
        Recordcount = (Recordcount + 1);
        
    }
        
    //  Fim
    
    return;
    
}

