function SyncStartingTheSynchronizer(User, Pass) {
    var EndMessage = "";
    var Server = "";
    var Result = 0;
    var Guidprocess = "";
    
    
    
    EndMessage = "Falha na sincronização, tente novamente.";
        
    
    
    Result = 1;
        
    //  Get SyncServer
    
    Server = ebfSQLDynamicQuery("select CON_VALUE from __RUNNER__CONFIG where CON_KEY = \'SERVER_URL\'", null, null, null).field("CON_VALUE", 'string');
        
    //  Todas as informações foram passadas?
    
    if ((isNullOrEmpty(Server) || isNullOrEmpty(User) || isNullOrEmpty(Pass))) {
        
        //  Error Message Informe o usuário e a senha para sincronizar os dados do dispositivo
        
        throw "Informe o usuário e a senha para sincronizar os dados do dispositivo";
            
        return;
        
    } else {
        
        //  Usuário autenticado?
        
        if ((trim(ebfGetURLContent(trim(((trim(Server) + "/SyncAutenticarUsuario.rule?sys=MSC") + "&User=" + trim(User) + "&Password=" + trim(Pass))))) == "1")) {
            
            //  Iniciar sincronismo!
            
            Guidprocess = trim(ebfGetURLContent(trim(((trim(Server) + "/Sync%20-%20Open%20Transaction.rule?sys=MSC&SiglaSistema=") + GetSystemProperties().get("syscode") + "&Usuario=" + User))));
                
            //  GUIDProcess = NOTHING?
            
            if ((Guidprocess == "NOTHING")) {
                
                //  Error Message Usuário não possui permissão de sincronização no sistema
                
                throw "Usuário não possui permissão de sincronização no sistema";
                    
                return;
                
            } else {
                
                //  Try
                
                try {
                //;
                    
                //  Begin Transaction
                
                ebfSQLOpenTransaction(null);
                    
                //  Sync - Enviar dados
                
                Result = SyncEnviarDados(User, Pass, Server, Guidprocess);
                    
                //  Commit Transaction
                
                ebfSQLCommitTransaction(null);
                    
                //  Set Message "Sincronizado com sucesso!"
                
                EndMessage = "Sincronização finalizada com sucesso!";
                    
                //  Catch
                
                } catch(e) {
                      ebfFlowExecute(reduceVariable("Sync - Efetuar ROLLBACK durante a exceção"), [ebfToString(e), e, e]);
                  };
                    
                //  Result = 0?
                
                if ((Result == 0)) {
                    
                    //  Error Message Não há dados para sincronizar
                    
                    throw "Não há dados para sincronizar";
                        
                    return;
                    
                } else {
                    
                    //  Sincronismo finalizado!
                    
                    alert(EndMessage);
                        
                    //  Fim
                    
                    return;
                    
                }
            }
        } else {
            
            //  Error Message Usuário ou senha inválido
            
            throw "Usuário ou senha inválido";
                
            return;
            
        }
    }
}

