function ExecuteSqlCommand(Command, ListValues, Table, Fields) {
    var ParamList;
    var ModifyList;
    var CounterFields = 0;
    var Type;
    var Value;
    var Query = "";
    var Column = "";
    var Metadata = "";
    var TableName = "";
    var MapColumns;
    var ListColumnsFullName;
    var KeyMapAux;
    var TamanhoMapa = 0;
    var FormGuid = "";
    var KeyField = "";
    
    
    
    CounterFields = 1;
        
    //  Get GUID
    
    FormGuid = formGUID;
        
    //  Get List Fields
    
    ParamList = Fields;
        
    //  Create List Modify
    
    ModifyList = new Array();
        
    //  List Fields >= Counter Fields?
    
    while ((ParamList.length >= CounterFields)) {
        
        //  Get column
        
        Column = ParamList[CounterFields-1];
            
        //  Convert to Field Type
        
        Value = ConvertToFieldType(Column, ListValues[CounterFields-1], Table);
            
        //  Entering the List of Values
        
        ebfSetElementAtList(ModifyList, Value, null);
            
        //  Counter++
        
        CounterFields = (CounterFields + 1);
        
    }
        
    //  Execute Scripting SQL
    
    ebfSQLExecuteDynamicUpdate(Command, null, ModifyList);
        
    //  Get Key Map Aux
    
    KeyMapAux = RetrieveFormData("KeyMapAux");
        
    //  Set session variable
    
    ebfSetSessionAttribute("KeyMapAux", KeyMapAux, false);
        
    //  Is Null?
    
    if (isNullOrEmpty(KeyMapAux)) {
        
        //  Fim
        
        return;
        
    } else {
        
        //  Size Map
        
        TamanhoMapa = ebfMapLength(KeyMapAux);
            
        //  Exist element in the map?
        
        if ((TamanhoMapa > 0)) {
            
            //  Save form data
            
            SaveFormData("KeyMap", KeyMapAux)
                
            //  Fim
            
            return;
            
        } else {
            
            //  Fim
            
            return;
            
        }
    }
}

