function FillUpWithFormsDefaultValues(ListSize, Items) {
    var Index = 0;
    var CurrentItem = "";
    var Definition;
    var DefaultValue;
    var FieldName = "";
    var MapDefaultValues;
    
    
    
    Index = 1;
        
    //  Create Default Map
    
    MapDefaultValues = ebfMapCreateObject();
        
    //  Has more?
    
    while ((Index <= ListSize)) {
        
        //  Get current item
        
        CurrentItem = Items[Index-1];
            
        //  Is empty?
        
        if (isNullOrEmpty(CurrentItem)) {
            
            //  Index++
            
            Index = (Index + 1);
            
        } else {
            
            //  Get default value definition
            
            Definition = ebfSplit(CurrentItem, "=");
                
            //  Default value
            
            DefaultValue = Definition[2-1];
                
            //  Field name
            
            FieldName = Definition[1-1];
                
            //  Get Parameters
            
            DefaultValue = GetParameters(DefaultValue);
                
            //  Add Map Default Values
            
            ebfMapAddObject(MapDefaultValues, FieldName, DefaultValue);
                
            //  Index++
            
            Index = (Index + 1);
            
        }
    }
        
    //  Fim
    
    return (MapDefaultValues);
    
}

