function GetParameters(DefaultValue) {
    var Result;
    
    //  IS FUNCTION ?
    
    if ((ebfSearchSubstring(DefaultValue, "FUNCAO(\"") || ebfSearchSubstring(DefaultValue, ":FUNCAO_"))) {
        
        //  Get Forms Component Default Values
        
        Result = GetFormsComponentDefaultValues(DefaultValue);
            
        //  Fim
        
        return (Result);
        
    } else {
        
        //  IS SQL?
        
        if (ebfSearchSubstring(DefaultValue, "SQL(\"")) {
            
            //  Get Query Result of Parameter Default
            
            Result = GetQueryResultOfParameterDefault(DefaultValue);
                
            //  Fim
            
            return (Result);
            
        } else {
            
            //  Is Component?
            
            if ((ebfSearchSubstring(DefaultValue.toLowerCase(), ":componente_") || ebfSearchSubstring(DefaultValue.toLowerCase(), ":component_"))) {
                
                //  Get Parameter Component
                
                Result = GetParameterComponent(DefaultValue);
                    
                //  Fim
                
                return (Result);
                
            } else {
                
                //  Is Field?
                
                if (ebfSearchSubstring(DefaultValue, ":")) {
                    
                    //  Get current field value
                    
                    Result = ebfSQLGetFormField(ebfReplace(DefaultValue, ":", ""));
                        
                    //  Fim
                    
                    return (Result);
                    
                } else {
                    
                    //  Fim
                    
                    return (DefaultValue);
                    
                }
            }
        }
    }
}

