function GetParameterSql(Sql) {
    var Search;
    var ListParams;
    var Param = "";
    var Counter = 0;
    var Read = "";
    var FilterList;
    
    
    
    Counter = 1;
        
    //  Filter List
    
    FilterList = ebfListParamsCreate("\\n", "\\t", "\\r", "\\", "\'", "\\\"", "\\\'", "\"", ")", "(", ",", "-", "+", ">", "<", "=", " ");
        
    //  create list param
    
    ListParams = new Array();
        
    //  length(SQL) >= counter?
    
    while ((Sql.length >= Counter)) {
        
        //  read
        
        Read = ebfSubstring(Sql, Counter, 1);
            
        //  exist in ":"?
        
        if ((ebfSearchSubstring(Read, ":") || Search)) {
            
            //  copy param
            
             Param =   Param + Read;
                
            //  search = true;
            
            Search = true;
                
            //  eof?
            
            if ((Search && (listContainsObject(FilterList,ebfToJSString(Read)) > 0))) {
                
                //  remove char eof
                
                Param = ebfSubstring(Param, 1, (Param.length - 1));
                    
                //  insert in list
                
                ebfSetElementAtList(ListParams, Param, null);
                    
                //  clear param
                
                Param = "";
                    
                //  search = false;
                
                Search = false;
                    
                //  counter++
                
                Counter = (Counter + 1);
                
            } else {
                
                //  counter++
                
                Counter = (Counter + 1);
                
            }
        } else {
            
            //  eof?
            
            if ((Search && (listContainsObject(FilterList,ebfToJSString(Read)) > 0))) {
                
                //  remove char eof
                
                Param = ebfSubstring(Param, 1, (Param.length - 1));
                    
                //  insert in list
                
                ebfSetElementAtList(ListParams, Param, null);
                    
                //  clear param
                
                Param = "";
                    
                //  search = false;
                
                Search = false;
                    
                //  counter++
                
                Counter = (Counter + 1);
                
            } else {
                
                //  counter++
                
                Counter = (Counter + 1);
                
            }
        }
    }
        
    //  Fim
    
    return (ListParams);
    
}

